import FormInput from "../components/common_inventory/FormInput";
import "./Register.css"
function Register() {


    return (
        <div className="center-div">

            <form className="register-container">
                <h2>Register</h2>

                <FormInput lable="Email Address" type="email"/>
                <FormInput lable="Password" type="password"/>
                <FormInput lable="Confirm Password" type="password"/>


            </form>
            
        </div>
    )


}
export default Register;
